<?php
$input = str_split("");
$protocol = array();
$found = 0;
$c=0;
while($c < count($input)){
    $j=0;
    for($i=$c; $i<$c+14; $i++) {
        $protocol[$j] = $input[$i];
        if(count($protocol)==14){
            print_r($protocol);
            echo " - ".count(array_unique($protocol))." - ";
            if (count(array_unique($protocol))<14){
                unset($protocol);
            } else {
                $line = $c+13;
                echo " Unique!".$line;
                unset($protocol);
                $found = 1;
                break;
            }
            echo "<br>";
        }
        $j++;
        if ($j>13) $j-=14;
    }
    if ($found==1) { break; }
    $c++;
}
//echo $c;
?>

